import React, { Component } from 'react';
import '../css/Header.css';

const MENU = [
    {
        name : "Home",
        href : "#home"
    },
    {
        name : "About",
        href : "#about"
    },
    {
        name : "Skills",
        href : "#skills"
    },
    {
        name : "Projects",
        href : "#projects"
    },
    {
        name : "Contact",
        href : "#contact"
    }
]

class Header extends Component{
    render() {
        return (
            <div id="menu">
                {MENU.map((menu) => (
                    <a href={menu.href}>{menu.name}</a>
                ))}
            </div>
        )
    }
}

export default Header;
